import React from "react";
import * as S from './Header.style';
import Meals from '../../assets/meals.jpeg';

const Header = (props) => {
    const {
        title,
    } = props;

    return (
        <React.Fragment>
            <S.Header>
                <h1>{title}</h1>
                <button>Cart</button>
            </S.Header>
            <S.Wrapper>
            <S.Image src={Meals} />
            </S.Wrapper>
        </React.Fragment>
    )
};

export default Header;
